import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { ActivatedRoute, Router } from '@angular/router';
import { finalize , tap } from 'rxjs';
import { AuthenticationService } from 'src/services/authentication.service';
import {User} from "../../models/User";
import Swal from "sweetalert2";

import {
  SocialAuthService,
  FacebookLoginProvider,
  SocialUser, SocialAuthServiceConfig,
} from '@abacritt/angularx-social-login';



@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent {
  name:String='';
  prenom:String='';
  loginForm!: FormGroup;
  submitted = false;
  error = '';
  loadingLogin = false;
  isLoading = false;
  socialUser!: SocialUser;
  isLoggedin?: boolean = undefined;
  private facebookAppId = '101357639726844';
  constructor(
    private formBuilder: FormBuilder,
    private router:Router,
    private authenticationService : AuthenticationService,
    private socialAuthService: SocialAuthService



  ) { }

  ngOnInit(): void {


    this.loginForm = this.formBuilder.group({
      email:  ['',[Validators.required,Validators.email]],
      password: ['',Validators.required],
    })
    this.socialAuthService.authState.subscribe((user) => {
      this.socialUser = user;
      this.isLoggedin = user != null;
    });
    this.authenticationService.getToken();
  }
  onSubmit() {

    this.submitted = true;
    this.loadingLogin = true;
    console.log(this.loginForm.value)
    this.authenticationService
      .login(this.loginForm.value)
      .subscribe({
        next: (data: User) => {
          this.name=this.authenticationService.myName();
          this.prenom=this.authenticationService.myPrenom();

          Swal.fire({
            icon: 'success',
            text: `Soyez les bienvenus ${this.name} ${this.prenom} `,
            showConfirmButton: false,
            timer: 1500
          });
          this.router.navigate(['/Home']);
        },
        error: (error) =>{
          Swal.fire({
            icon: 'error',
            text: `Connexion impossible`,
            showConfirmButton: false,
            timer: 1500
          });
          console.log('Login failed',error);

        }
      });


  }
  loginWithFacebook(): void {
    this.socialAuthService.signIn(FacebookLoginProvider.PROVIDER_ID);
  }
  signOut(): void {
    this.socialAuthService.signOut();
  }



}
<body>

<div>
  <img src="../../assets/GEOTRACKER.png" alt="notFound" style="position: relative; left: 600px; top: 50px" />
  <img src="../../assets/Talan.png" style="position: relative; right: 450px; width: 10%; height: 4%; top: 0px" />
  <div class="container mt-5 d-flex justify-content-center">
    <div
      style="background: rgba(0, 0, 0, 0.1); position: relative; left: 70px; top: 70px; width: 40%; height: 510px; border-radius: 10%"
      class="card"
    >
      <div class="card-body">
        <h3 style="color: white; position: relative; left: 60px" class="card-title">
          <a style="color: white; text-decoration: none" href="/Register">Inscription</a>
        </h3>
        <h3 style="color: white; position: relative; left: 270px; bottom: 41px" class="card-title">
          <a style="color: white" href="">Connexion</a>
        </h3>
        <form [formGroup]="loginForm" style="display: flex; flex-direction: column">


          <div class="form-group">
            <h5  for="email">Adresse mail:</h5>
            <input

              style="border: none; background: transparent; border-bottom: 1px solid #fff; color: white; width: 85%"
              name="email"
              formControlName="email"
              type="text"
              id="email"
              class="form-control"

            />
          </div>

            <div>
              <h5 for="password">Mot de passe:</h5>
              <input
                style="border: none; background: transparent; border-bottom: 1px solid #fff; color: white; width: 85%"
                name="password"
                formControlName="password"
                type="password"
                id="password"
                class="form-control"

              />
            </div>



          <br>
          <button (click)="onSubmit()" style="width: 40%; position: relative; left: 140px; border-radius: 10%" type="submit" class="btn btn-primary">
            Se connecter
          </button>
          <br>
          <p style="position: relative; left: 220px">OU</p>
          <button (click)="loginWithFacebook()" style="background: transparent; width: 51%; color: white" type="submit" class="btn btn-primary">
            <fa-icon [icon]="['fab', 'facebook']"></fa-icon>
            Connexion avec Facebook
          </button>

          <button
            style="background: transparent; width: 51%; position: relative; bottom: 38px; left: 250px; color: white"
            type="submit"
            class="btn btn-primary"
          >
            <fa-icon [icon]="['fab','google']"></fa-icon>
            Connexion avec Gmail
          </button>
          <h6 style="position:relative;left:150px">
           <a href="resetPassword" target="_blank" style="text-decoration: none"> Mot de passe oublié ?</a>
          </h6>
        </form>
      </div>
    </div>

    <div style="position: relative; left: 71px; top: 70px; width: 40%; height: 450px; border-radius: 30%" class="card">
      <img
        src="https://img.freepik.com/premium-vector/navigation-route-track-mobile-cell-phone-app-3d-icon-vector-city-map-with-gps-location-pin-pointer-marker-delivery-shipping-geo-location-online-cellphone-smartphone-image-run-fitness-tracker_101884-2170.jpg?w=2000"
        alt="React Image"
      />
    </div>
  </div>
</div>

</body>
